PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_caixa" ("id_caixa" char(32) NOT NULL PRIMARY KEY, "insert" datetime NOT NULL, "update" datetime NOT NULL, "saldo_inicial" decimal NULL, "saldo_final" decimal NULL, "loja_id" integer NOT NULL REFERENCES "app_loja" ("id_loja") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_motoboy" ("id_motoboy" char(32) NOT NULL PRIMARY KEY, "nome" varchar(255) NOT NULL, "numero" varchar(20) NOT NULL, "insert" datetime NOT NULL, "update" datetime NOT NULL, "empresa_id" integer NULL REFERENCES "app_empresa" ("id_empresa") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_transacao" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "valor" decimal NOT NULL, "descricao" varchar(100) NOT NULL, "insert" datetime NOT NULL, "update" datetime NOT NULL, "caixa_id" char(32) NOT NULL REFERENCES "app_caixa" ("id_caixa") DEFERRABLE INITIALLY DEFERRED, "venda_id" char(32) NULL REFERENCES "app_venda" ("id_venda") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_entrega" ("id_entrega" char(32) NOT NULL PRIMARY KEY, "valor_entrega" decimal NOT NULL, "time_pedido" time NULL, "time_finalizacao" time NULL, "insert" datetime NOT NULL, "update" datetime NOT NULL, "descricao" text NULL, "motoboy_id" char(32) NULL REFERENCES "app_motoboy" ("id_motoboy") DEFERRABLE INITIALLY DEFERRED, "venda_id" char(32) NOT NULL UNIQUE REFERENCES "app_venda" ("id_venda") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_associado" ("id_associado" char(32) NOT NULL PRIMARY KEY, "insert" datetime NOT NULL, "status_acesso" bool NULL, "loja_id" integer NULL REFERENCES "app_loja" ("id_loja") DEFERRABLE INITIALLY DEFERRED, "usuario_id" integer NULL REFERENCES "app_usuario" ("id_usuario") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_cliente" ("id_cliente" char(32) NOT NULL PRIMARY KEY, "nome_cliente" varchar(255) NOT NULL, "telefone_cliente" varchar(20) NULL, "ultima_compra" date NULL, "insert" datetime NOT NULL, "tipo_cliente" varchar(50) NULL, "descricao_cliente" varchar(300) NULL, "empresa_id" integer NULL REFERENCES "app_empresa" ("id_empresa") DEFERRABLE INITIALLY DEFERRED, "endereco_id" integer NULL REFERENCES "app_endereco" ("id_endereco") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_configuracao" ("id_configuracao" char(32) NOT NULL PRIMARY KEY, "codigo" integer NULL, "titulo" text NULL, "descricao" text NULL, "descricao_interna" text NULL, "insert" datetime NOT NULL, "status_acesso" bool NOT NULL, "usuario_id" integer NULL REFERENCES "app_usuario" ("id_usuario") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_empresa" ("id" char(32) NOT NULL, "id_empresa" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome_empresa" text NOT NULL, "nro_cnpj" text NOT NULL, "razao_social" text NULL, "descricao" text NULL, "nome_responsavel" text NOT NULL, "cargo" text NOT NULL, "email" varchar(254) NOT NULL, "nro_cpf" text NOT NULL, "telefone" text NOT NULL, "insert" datetime NOT NULL, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_endereco" ("id_endereco" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "id" char(32) NOT NULL, "rua" varchar(255) NOT NULL, "numero" varchar(10) NULL, "bairro" varchar(100) NULL, "cidade" varchar(100) NULL, "estado" varchar(50) NULL, "codigo_postal" varchar(30) NULL, "descricao" text NULL, "insert" datetime NOT NULL, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_galao" ("id_galao" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "data_validade" varchar(50) NULL, "data_fabricacao" varchar(50) NULL, "descricao" text NULL, "quantidade" integer NOT NULL, "titulo" varchar(100) NULL, "insert" datetime NOT NULL, "loja_id" integer NULL REFERENCES "app_loja" ("id_loja") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_gestaogalao" ("id_gestao_galao" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "insert" datetime NOT NULL, "descricao" text NULL, "galao_entrando_id" integer NULL REFERENCES "app_galao" ("id_galao") DEFERRABLE INITIALLY DEFERRED, "galao_saiu_id" integer NULL REFERENCES "app_galao" ("id_galao") DEFERRABLE INITIALLY DEFERRED, "venda_id" char(32) NULL REFERENCES "app_venda" ("id_venda") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_historico" ("id_historico" char(32) NOT NULL PRIMARY KEY, "descricao" text NULL, "insert" datetime NOT NULL, "usuario" char(32) NOT NULL, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_itemcompra" ("id_item_compra" char(32) NOT NULL PRIMARY KEY, "quantidade" integer NOT NULL, "insert" datetime NOT NULL, "produto_id" char(32) NULL REFERENCES "app_produto" ("id_produto") DEFERRABLE INITIALLY DEFERRED, "venda_id" char(32) NULL REFERENCES "app_venda" ("id_venda") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_log" ("id_log" char(32) NOT NULL PRIMARY KEY, "tipo" varchar(50) NOT NULL, "origem" varchar(100) NOT NULL, "descricao" text NOT NULL, "insert" datetime NOT NULL, "ip_usuario" varchar(50) NULL, "usuario_id" integer NULL REFERENCES "app_usuario" ("id_usuario") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_loja" ("id_loja" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome_loja" varchar(255) NOT NULL, "numero_telefone" varchar(50) NULL, "horario_operacao_inicio" time NULL, "horario_operacao_fim" time NULL, "segunda" bool NOT NULL, "terca" bool NOT NULL, "quarta" bool NOT NULL, "quinta" bool NOT NULL, "sexta" bool NOT NULL, "sabado" bool NOT NULL, "domingo" bool NOT NULL, "insert" datetime NOT NULL, "empresa_id" integer NOT NULL REFERENCES "app_empresa" ("id_empresa") DEFERRABLE INITIALLY DEFERRED, "endereco_id" integer NULL REFERENCES "app_endereco" ("id_endereco") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_sessao" ("id_sessao" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "id" char(32) NOT NULL, "ip_sessao" varchar(100) NOT NULL, "descricao" varchar(200) NULL, "pagina_atual" varchar(200) NULL, "time_iniciou" datetime NULL, "status" bool NOT NULL, "insert" datetime NOT NULL, "cidade" varchar(100) NULL, "regiao" varchar(100) NULL, "pais" varchar(100) NULL, "codigo_postal" varchar(20) NULL, "organizacao" varchar(200) NULL, "usuario_id" integer NULL REFERENCES "app_usuario" ("id_usuario") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_usuario" ("id" char(32) NOT NULL, "id_usuario" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome_completo" varchar(255) NOT NULL, "nome_usuario" varchar(50) NOT NULL, "senha" varchar(200) NOT NULL, "insert" datetime NOT NULL, "nivel_usuario" integer NOT NULL, "status_acesso" bool NOT NULL, "email" varchar(255) NOT NULL, "ultimo_login" datetime NULL, "empresa_id" integer NOT NULL REFERENCES "app_empresa" ("id_empresa") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_venda" ("id_venda" char(32) NOT NULL PRIMARY KEY, "data_venda" date NOT NULL, "forma_pagamento" varchar(50) NOT NULL, "estado_transacao" varchar(20) NULL, "metodo_entrega" varchar(50) NULL, "desconto" varchar(50) NULL, "valor_total" decimal NOT NULL, "valor_entrega" varchar(50) NULL, "valor_pago" decimal NULL, "troco" decimal NULL, "insert" datetime NOT NULL, "descricao" text NULL, "nota_fiscal" decimal NULL, "cliente_id" char(32) NULL REFERENCES "app_cliente" ("id_cliente") DEFERRABLE INITIALLY DEFERRED, "loja_id" integer NOT NULL REFERENCES "app_loja" ("id_loja") DEFERRABLE INITIALLY DEFERRED, "usuario_id" integer NOT NULL REFERENCES "app_usuario" ("id_usuario") DEFERRABLE INITIALLY DEFERRED, "update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_produto" ("id_produto" char(32) NOT NULL PRIMARY KEY, "nome" varchar(255) NOT NULL, "quantidade_atual_estoque" integer NULL, "quantidade_minima_estoque" integer NULL, "is_retornavel" bool NULL, "data_validade" varchar(50) NULL, "insert" datetime NOT NULL, "update" datetime NOT NULL, "preco_compra" decimal NULL, "preco_venda" decimal NULL, "fabricante" varchar(100) NULL, "descricao" text NULL, "loja_id" integer NOT NULL REFERENCES "app_loja" ("id_loja") DEFERRABLE INITIALLY DEFERRED, "codigo" integer unsigned NOT NULL UNIQUE CHECK ("codigo" >= 0));
